  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113896 includes tows and
  biological data collected aboard the ALPHA HELIX and WECOMA during cruises HX201,
  HX203, HX205, HX208, HX211, HX215, HX217, HX218, HX219, HX223, HX225, HX228, HX230,
  HX231, HX234, HX237, HX239, HX241, HX243, HX246, HX248, HX252, HX254, HX257, HX258,
  HX262, HX263, HX267, HX269, HX270, HX272, HX276, HX279, HX281, HX283, HX286, HX292
  and W0307A in the Gulf of Alaska from 1997-10-10 to 2004-10-07. These data include
  BIOMASS, SPECIES IDENTIFICATION, TAXONOMIC CODE, SPECIES IDENTIFICATION - LIFE STAGE
  and species abundance. The instruments used to collect these data include net -
  zooplankton net. These data were collected by Ken Coyle and Seth Danielson of University
  of Alaska Fairbanks as part of NEP. The Biological and Chemical Oceanography Data
  Management Office (BCO-DMO) submitted these data to NODC on 2013-09-28.nnThe following
  is the text of the abstract provided by BCO-DMO:nnCalVET catch data - zooplankton
  species abundance and biomass, 1997 - 2004nUpdated July 2008.nAll data are for 149
